public class MultilicationTable {
    public static void main(String[] args) {
        int num1 = 20;
        int num2 = 5;
        if (num2 != 0) {
            int result = num1 / num2;
            System.out.println("Division of " + num1 + " by " + num2 + " is: " + result);
        } else {
            System.out.println("Cannot divide by zero.");
        }
    }
        
    }

    

